"<p>This website is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about \"%s\".</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the menu instead.</p>\n\n<p>If needed, skins can format info pages differently from regular posts.</p>" => "<p>Ce blog est propulsé par b2evolution.</p>\n\n<p>Vous consultez actuellement la page à propos du \"%s\".</p>\n\n<p>Les pages d'information ressemblent beaucoup à des posts habituels, sauf qu'ils ne figurent pas dans le flux régulier des posts. Au lieu de cela, elles apparaissent comme pages d'informations dans le menu.</p>\n\n<p>Si nécessaire, les skins peuvent afficher les pages d'information différemment des posts réguliers.</p>",
'The software for blog pros!' => 'Le logiciel pour les pros du blog!',
