"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this site.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the menu instead.</p>\n\n<p>If needed, skins can format info pages differently from regular posts.</p>" => "<p>Ce blog est propulsé par b2evolution.</p>\n\n<p>Vous consultez actuellement la page à propos du site.</p>\n\n<p>Les pages d'information ressemblent beaucoup à des posts habituels, sauf qu'ils ne figurent pas dans le flux régulier des posts. Au lieu de cela, elles apparaissent comme pages d'informations dans le menu.</p>\n\n<p>Si nécessaire, les skins peuvent afficher les pages d'information différemment des posts réguliers.</p>",
'About this site' => 'A propos de ce site',
"<p>This is the Home page of this site.</p>\n\n<p>More specifically it is the \"Front page\" of the first collection of this site. This first collection is called \"Home\". Other sample collections have been created. You can access them by clicking \"Blog A\", \"Blog B\", \"Photos\", etc. in the menu bar at the top of this page.</p>\n\n<p>You can add collections at will. You can also remove them (including this \"Home\" collection) if you don't need one.</p>" => "<p>Ceci est la page d'accueil du site.</p>\n\n<p>Plus précisément, il s'agit de la \"Page de garde\" (\"Front page\") de la première collection de ce site. Cette première collection est nommée \"Accueil\". D'autres collections d'exemples ont été créées. Vous pouvez y accéder en cliquant sur \"Blog A\", \"Blog B\", \"Photos\", etc. dans la bare de menu apparaissant en haut de cette page.</p>\n\n<p>Vous pouvez ajouter des collections à volonté. Vous pouvez également en supprimer (y compris cette collection \"Accueil\") si vous n'en avez pas l'utilité.</p>",
'Homepage post' => 'Post de la page d\'accueil',
'Main Intro post' => 'Post d\'Intro principal',
'This is the main intro post. It appears on the homepage only.' => 'Ceci est le post d\'intro principal. Il apparait uniquement sur la page d\'accueil.',
"<p>This is the first post.</p>\n\n<p>It appears in a single category.</p>" => "<p>Ceci est le premier post.</p>\n\n<p>Il apparait dans une seule catégorie.</p>",
'First Post' => 'Premier post',
"<p>This is the second post.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Ceci est le second post.</p>\n\n<p>Il apparait dans de multiples catégories.</p>",
'Second post' => 'Second post',
'About Blog A' => 'A propos du Blog A',
'Blog A' => 'Blog A',
"<p>This is page 1 of a multipage post.</p>\n\n<blockquote><p>This is a Block Quote.</p></blockquote>\n\n<p>You can see the other pages by clicking on the links below the text.</p>" => "<p>Ceci est la page 1 d'un post composé de plusieurs pages.</p>\n\n<blockquote><p>Ceci est un citation (Block Quote).</p></blockquote>\n\n<p>Vous pouvez voir les autres pages en cliquant sur les liens sous le texte.</p>",
'This is a multipage post' => 'Ceci est un post de plusieurs pages',
'<p>This is page %d.</p>' => '<p>Ceci est la page %d.</p>',
'<p>It is the last page.</p>' => '<p>C\'est la dernière page.</p>',
'<p>This is an extended post with no teaser. This means that you won\'t see this teaser any more when you click the "more" link.</p>' => '<p>Ceci est un post étendu sans accroche. Ceci signifie que vous ne verrez plus ce teaser lorsque vous aurez cliqué sur le lien "lire la suite".</p>',
