'<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>' => '<p>Ceci est un post étendu. Ceci signifie que vous voyez seulement un petit teaser par défaut et que vous devez cliquer sur le lien ci-dessous pour voir la suite.</p>',
'Extended post' => 'Post étendu',
'<p>This post has a special post type called "Post with custom fields".</p>' => '<p>Ce post a un type de post spécial nommé "Post avec champs personnalisés".</p>',
'Custom Fields Example' => 'Exemple de Post avec Champs Personnalisés',
