"<p>This topic has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Ce sujet a une image en pièce jointe. L'image est automatiquement redimensionnée afin de pouvoir s'adapter à la skin actuelle du blog. Vous pouvez zoomer en cliquant sur ​​la miniature.</p>\n\n<p>Découvrez le blog photo (accessible via les liens en haut) pour voir une skin complètement différente et davantage axée sur les photos que sur le texte de blog.</p>",
