"<p>This is an extended topic. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Ceci est un sujet étendu. Cela signifie que vous voyez seulement ce court teaser et que vous devez cliquer sur le lien ci-dessous pour en voir plus.</p>\n\n[teaserbreak]\n\n<p>Ceci est le texte étendu. Vous ne le voyez que lorsque vous avez cliqué sur le lien \"lire la suite\".</p>",
