'Database you want to install into' => 'Base de données dans laquelle vous voulez installer',
'b2evolution stores blog posts, comments, user permissions, etc. in a MySQL database. You must create this database prior to installing b2evolution and provide the access parameters to this database below. If you are not familiar with this, you can ask your hosting provider to create the database for you.' => 'b2evolution stocke les posts, commentaires, permissions utilisateurs, etc. dans une base de données MySQL. Vous devez créer cette base de données avant d\'installer b2evolution et fournir les paramètres d\'accès à cette base ci-dessous. Si cette procédure ne vous est pas familière, vous pouvez demander à votre hébergeur de créer cette base de données pour vous.',
