'Additional settings' => 'Réglages additionnels',
'This is where b2evo and your blogs reside by default. CHECK THIS CAREFULLY or not much will work. If you want to test b2evolution on your local machine, in order for login cookies to work, you MUST use http://<strong>localhost</strong>/path... Do NOT use your machine\'s name!' => 'Il s\'agit de l\'endroit où b2evo et vos blogs sont accessibles par défaut. VERIFIEZ CECI MINUTIEUSEMENT ou peu de choses fonctionneront correctement. Si vous voulez tester b2evolution sur votre machine locale, de manière à ce que les cookies fonctionnent, vous DEVEZ utiliser http://<strong>localhost</strong>/chemin... N\'utilisez PAS le nom de votre machine!',
