'Update config file' => 'Mise à jour du fichier de configuration',
'How would you like your b2evolution installed?' => 'Comment désirez vous installer votre b2evolution?',
'In order to install b2evolution with the %s locale, your MySQL needs to support the %s connection charset.' => 'Pour installer b2evolution avec le %s local, votre MySQL doit prendre en charge le %s jeu de caractère de connexion.',
'WARNING: Some of your tables have a different charset than the expected %s. You should normalize your database after upgrade.' => 'ATTENTION: Certaines de vos tables utilisent un jeu de caractères différent de jeu %s attendu. Il est recommandé de normaliser votre base de données après la mise à jour.',
'WARNING: Some of your tables have a different charset than the expected %s. It is strongly recommended to normalize your database charset by running the preselected task below:' => 'ATTENTION: Certaines de vos tables utilisent un jeu de caractères différent de jeu %s attendu. Il est fortement recommandé de convertir le jeu de caractères de votre base de données en utilisant la tâche présélectionnée ci-dessous:',
'The installation can be done in different ways. Choose one:' => 'L\'installation peut être effectuée de différentes manières. Choisissez en une:',
'<strong>New Install</strong>: Install the b2evolution database tables. Optionally add some default contents.' => '<strong>Nouvelle installation</strong>: Installer les tables b2evolution dans la base. Ajouter des contenus d\'exemple en option.',
'<strong>Upgrade from a previous version of b2evolution</strong>: Upgrade your b2evolution database tables in order to make them compatible with the current version. <strong>WARNING:</strong> If you have modified your database, this operation may fail. Make sure you have a backup.' => '<strong>Mise à jour depuis une version précédente de b2evolution</strong>: Mise à jour des tables b2evolution dans la base de manière à les rendre compatibles avec la version en cours! <strong>ATTENTION:</strong> Si vous avez modifié la structure de votre base de données, cette opération risque d\'échouer. Assurez vous de disposer d\'un back-up.',
'<strong>Delete b2evolution tables &amp; cache files. WARNING:</strong> All your b2evolution tables and data will be lost! Any non-b2evolution tables will remain untouched.' => '<strong>Supprimer les tables &amp; et les fichiers cache de b2evolution. ATTENTION: Toutes vos tables et données b2evolution seront perdues!!!</strong> Toute table n\'appartenant pas à b2evolution restera cependant inchangée.',
'<strong>Change your base configuration</strong> (see recap below): You only want to do this in rare occasions where you may have moved your b2evolution files or database to a different location...' => '<strong>Modifier votre configuration de base</strong> (voir recap ci-dessous): Vous n\'aurez besoin de cette option qu\'en de rares occasions où vous pourriez avoir déplacé vos fichiers b2evolution ou votre base de données...',
'<strong>Convert/Normalize your DB to UTF-8/ASCII</strong>: The content tables in your b2evolution MySQL database will be converted to UTF-8 instead of their current charset. Some system tables will also be converted to plain ASCII for better performance.' => '<strong>Convertissez/Normalisez votre BD vers UTF-8</strong>: toutes les tables de b2evolution dans votre base MySQL b2evolution seront converties vers UTF-8 en lieu et place de leur jeu de caractères actuel. Certaines tables système seront également converties en ASCII pour une meilleur performance.',
